import { Route, Routes } from 'react-router-dom';
import './App.css';
import Navbar from './components/Navbar/Navbar';
import homepage from './pages/homepage';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
      <Route path="/homepage" component={homepage} />
      </Routes>
    </div>
  );
}

export default App;
